import React from 'react';
import "./counting.css";
import CountUp from 'react-countup';

const Counting = () => {
  return (
    <div className="counting">
        <div className="sub-count">
          <p>
            <CountUp end={90000} duration={2.5} />+ <br/> Listings
          </p>
        </div>
        <div className="sub-count">
          <p>
            <CountUp end={34000} duration={2.5} />+ <br/> Listing Categories
          </p>
        </div>
        <div className="sub-count">
          <p>
            <CountUp end={56000} duration={4.5} />+ <br/> Visitors
          </p>
        </div>
        <div className="sub-count">
          <p>
            <CountUp end={13000} duration={5.5} />+ <br/> Happy Clients
          </p>
        </div>
    </div>
  );
}

export default Counting;
